function Home() {
    const modalReducer = useSelector((state) => state.modalReducer);
    return (
        <div>
            <Navbar />
            {openModal === 'OPEN_LOGIN'  ?  <LoginModal /> : ''}
            {/* {openRegister ? <Register />    : ''} */}
        </div>
    )
}

export default Home
